import React from 'react';
import DropdownBtn from './DropdownBtn';

class App extends React.Component {
    render() {
        return (
            <div className="container">
                <header>
                    <div className="notch"/>
                    <DropdownBtn />
                </header>
            </div>
        )
    }
}

export default App;
